import './App.css';
import NavBar from "./components/navbar"
import Home from "./components/home"
import AboutView from './components/aboutView';
import {Switch, Route} from 'react-router-dom' 




function App() {
  return (
    <div >
      <NavBar />
      <Switch>

        <Route path="/">
          <Home />
        </Route>

        <Route path="/about">
          <AboutView />
        </Route>

      </Switch>

    </div>
  );
}

export default App;
